INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("フリーマーケット会場", 0, "ペコリーヌとの出会い", 1, 2834, 10118, 2, 8, 91002, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 5118061, "青空の下で謁見", 7, 40, 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("フリーマーケット会場", 0, "マホとの出会い", 1, 2835, 10118, 2, 8, 91002, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 5118062, "未来の騎空団\nマスコット？", 7, 40, 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("ランドソル市街地", 0, "アキノとの出会い", 1, 2837, 10118, 2, 8, 91002, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 5118063, "お嬢さまからの\n緊急依頼", 7, 40, 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("フリーマーケット会場", 0, "ジュンとの出会い", 1, 4108402, 10118, 2, 8, 91002, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 5118064, "黄金色の悩みごと", 18, 40, 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("フリーマーケット会場", 0, "カオリとの出会い", 1, 4107402, 10118, 2, 8, 91002, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 5118065, "白熱！　格闘大会！", 18, 40, 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("オーエド町", 1, "ニノンとの出会い", 1, 9000227, 10118, 2, 8, 91002, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 5118066, "祭り太鼓はオーエドの華", 16, 40, 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("フリーマーケット会場", 0, "スズナとの出会い", 1, 2101181, 10118, 3, 8, 91002, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 5118067, "人気者は遅れて\nやってくる", 19, 40, 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("ランドソル市街地", 0, "ナナカとの出会い", 1, 4109402, 10118, 3, 8, 91002, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 5118068, "巫女・ミーツ・魔法少女", 18, 40, 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("フリーマーケット会場", 0, "キャル＆コッコロとの出会い", 1, 4305402, 10118, 3, 8, 91002, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 5118069, "ネズ耳は二度なくなる", 18, 40, 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("ランドソル市街地", 0, "ユカリとの出会い", 1, 4101402, 10118, 3, 8, 91002, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 5118070, "この出会いにカンパイ！", 18, 40, 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("ランドソル市街地", 0, "アオイとの出会い", 1, 4106402, 10118, 3, 8, 91002, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 5118071, "陰陽アンサンブル", 18, 40, 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("フリーマーケット会場", 1, "シノブとの出会い", 1, 2836, 10118, 3, 8, 91002, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 5118072, "運試し十番勝負！", 7, 40, 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (0, 0, "オープニング", 0, 0, 10118, 1, 0, 0, 0, 5118600, "彼女たちの新たな日常", 0, 0, 20063115);
